import Input from '../../UI/Input';

const BookItemForm = (props) => {
    return (
        <div>
            <form>
                <Input 
                    label="Checkout"
                    input={{
                        id: "chk_" + props.isbn,
                        type:'checkbox'
                    }}
                />
                <button>
                    Add
                </button>
            </form>
        </div>
    )
}

export default BookItemForm;
